import React from 'react'
import iconPaper from '../assest/icon-paper.svg';
import iconRock from '../assest/icon-rock.svg';
import iconScissors from '../assest/icon-scissors.svg';
import { language } from '../utils/utils';

function Game() {
    return (
        <div className='w-full min-h-96 p-6 bg-white'>
            <div className='w-full h-max p-6 flex gap-16'>
            <img src={iconPaper} className="w-36 h-24" alt="logo" />
            <img src={iconScissors} className="w-36 h-24" alt="logo" />
            </div>
        </div>
    )
}

export default Game
